b'Coming soon: #LVMenSS21
@VirgilAbloh has imagined his next #LouisVuitton collection as a virtual and literal voyage around the world. Watch the first chapter of the journey on Friday, July 10th at 2:30 PM (CET) at louisvuitton.com

Illustration by #reggieknow #fashionfigureinc @fashionfigureinc'

b'#LouisVuitton\xe2\x80\x99s newest Maison opens its doors on February 1st in the Midosuji district of Osaka, Japan. Featuring a #JunAoki designed facade and #PeterMarino interiors, the imaginative structure houses the very first Le Caf\xc3\xa9 V as well as celebrated chef #YosukeSuga\xe2\x80\x99s Sugalabo V restaurant. #Rola, #SuzuHirose, #TakanoriIwata, #EbizoIchikawa and #DanCarter were among the guests who attended the flagship\xe2\x80\x99s opening, which featured a special live performance by the J-Pop group #JO1 and DJ #Sarasa. See the full film on IGTV and learn more at louisvuitton.com

